import styled from "styled-components";

export const Wrapper = styled.div`
background-color: black;
width: 100vw;
padding: 50px;
`;

export const Content = styled.div`
display: flex;
width: 200px;
height: 200px;
`;

export const ImageWrapper = styled.div`

`;
export const Image = styled.img`
width: 100%;
height: 100%;
border-radius: 50%;
object-fit: cover;

`;
